                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis 
                        dataKey="date" 
                        scale="auto" 
                        tick={{ fontSize: 12 }} 
                        tickFormatter={(val) => val.substring(0, 3)}
                      />
                      <YAxis />
                      <RechartsTooltip />
                      <Legend />
                      <Bar 
                        dataKey="directCommission" 
                        name="Direct Commission" 
                        fill="#8884d8" 
                        barSize={20} 
                      />
                      <Line 
                        type="monotone" 
                        dataKey="networkCommission" 
                        name="Network Commission" 
                        stroke="#ff7300" 
                        strokeWidth={2} 
                      />
                    </ComposedChart>
                  </ResponsiveContainer>
                </Box>
              </Paper>
            </Grid>

