                      commission: 245.00,
                      status: 'active'
                    },
                    { 
                      id: 2, 
                      name: 'Sarah Johnson', 
                      email: 'sarah@example.com',
                      level: 'Level 1',
                      joinDate: '2023-02-10',
                      tradingVolume: 18750,
                      commission: 187.50,
                      status: 'active'
                    },
                    { 
                      id: 3, 
                      name: 'Mike Peterson', 
                      email: 'mike@example.com',
                      level: 'Level 2',
                      joinDate: '2023-02-20',
                      tradingVolume: 9300,
                      commission: 46.50,
                      status: 'active'
                    },
                    { 
                      id: 4, 
                      name: 'Jessica Lee', 
                      email: 'jessica@example.com',
                      level: 'Level 2',
                      joinDate: '2023-03-05',
                      tradingVolume: 5100,
                      commission: 25.50,
                      status: 'inactive'
                    },
                    { 
                      id: 5, 
                      name: 'David Wilson', 
                      email: 'david@example.com',
                      level: 'Level 3',
                      joinDate: '2023-03-15',
                      tradingVolume: 3200,
                      commission: 6.40,
                      status: 'active'
                    }
                  ].map((member) => (
                    <TableRow key={member.id} hover>
                      <TableCell>
                        <Typography variant="body2">{member.name}</Typography>
                        <Typography variant="caption" color="text.secondary">
                          {member.email}
                        </Typography>
                      </TableCell>
                      <TableCell>{member.level}</TableCell>
                      <TableCell>{new Date(member.joinDate).toLocaleDateString()}</TableCell>
                      <TableCell align="right">
                        ${member.tradingVolume.toLocaleString()}
                      </TableCell>
                      <TableCell align="right">
                        ${member.commission.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 2 })}
                      </TableCell>
                      <TableCell>
                        <Chip 
                          label={member.status} 
                          size="small" 
                          color={member.status === 'active' ? 'success' : 'default'} 
                        />
                      </TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          </Paper>
        </>
      )}

    </Box>
  );
};

export default CommissionTracker;
